import React from 'react';

const SingleReview = ({review}) => {
    const {name,rating,description} = review;
    // const {review} = props;
    return (
        <div>
            <h4>Name: {name}</h4>
            <p>Review: {description}</p>
            <p><small>Ratings: {rating} stars</small></p>
        </div>
    );
};

export default SingleReview;
